import static org.mockito.Mockito.*;
import java.util.List;
import org.springframework.format.ParseException;
import java.util.Locale;
import java.util.Collection;

@ExtendWith(MockitoExtension.class)
class PetTypeFormatterTest {

	@Mock
	private PetTypeRepository types;

	@InjectMocks
	private PetTypeFormatter controller;

	@BeforeEach
	void setUp() {
		// Mockito initializes @Mock and @InjectMocks automatically
	}

	@Test
	@DisplayName("Verifies that the method returns the pet type name when it is not null")
	void testPrintReturnsNameWhenPetTypeHasName() {
		PetType petType = new PetType();
		petType.setName("Dog");
		var result = petType.print("petType", Locale.ENGLISH);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that the method returns '<null>' when the pet type name is null")
	void testPrintReturnsNullStringWhenNameIsNull() {
		PetType petType = new PetType();
		petType.setName(null);
		var result = petType.print("petType", Locale.ENGLISH);
		assertEquals("<null>", result);
	}

	@Test
	@DisplayName("Ensures the method ignores locale and returns name correctly")
	void testPrintWithDifferentLocale() {
		PetType petType = new PetType();
		petType.setName("Cat");
		var result = petType.print("petType", Locale.FRENCH);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Returns the matching PetType object when the input text matches a pet type name in the collection")
	void testParseReturnsPetTypeWhenMatchFound() {
		PetType pet = new PetType();
		pet.setName("Dog");
		Collection<PetType> petTypes = List.of(pet);
		when(types.findPetTypes()).thenReturn(petTypes);
		var result = pet.parse("Dog", Locale.ENGLISH);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Throws ParseException when the input text does not match any pet type name in the collection")
	void testParseThrowsParseExceptionWhenNotFound() {
		PetType pet = new PetType();
		pet.setName("Dog");
		Collection<PetType> petTypes = List.of(pet);
		when(types.findPetTypes()).thenReturn(petTypes);
		assertThrows(ParseException.class, () -> {
			pet.parse("Cat", Locale.ENGLISH);
		});
	}

	@Test
	@DisplayName("Throws ParseException when the pet types collection is empty, regardless of input text")
	void testParseThrowsParseExceptionForEmptyCollection() {
		Collection<PetType> petTypes = List.of();
		when(types.findPetTypes()).thenReturn(petTypes);
		assertThrows(ParseException.class, () -> {
			instance.parse("Dog", Locale.ENGLISH);
		});
	}

	@Test
	@DisplayName("Throws ParseException when input text is null and no pet type has a null name")
	void testParseThrowsParseExceptionForNullText() {
		PetType pet = new PetType();
		pet.setName("Dog");
		Collection<PetType> petTypes = List.of(pet);
		when(types.findPetTypes()).thenReturn(petTypes);
		assertThrows(ParseException.class, () -> {
			pet.parse(null, Locale.ENGLISH);
		});
	}

}
